/*
En mi caso use jspdf. En el index.html del archivo podes encontrar el script que tenes que usar para que funcione.

Inicio

  Para generar un pdf primero debemos generar una variable del nombre que quieras abajo el Ej:

  var nombreQueVosQuieras = new window.jspdf.jsPDF()

  Dentro de los parentesis el formato que le quieras dar al pdf:

  {orientation: 'p',unit: 'mm',format: 'a5',putOnlyUsedFonts:true} <-- en la documentacion de la libreria podes encontrar mas de como funciona. Con esto ya podes empezar algo basico



Funciones basicas especificas de jspd

  Con lo explicado arriba automaticamente generas una pagina de pdf totalmente en blanco agregando la siguiente funcion:

  pdf.save(`NombreQueQuierasDelPDF.pdf`); <--- con esto guardas el pdf con ese nombre y automaticamente lo descarga a tu computadora

  pdf.text("TuTexto", 40, 30); <--- Con esto añadis texto al pdf donde dice "40" podes mover ese texto en el eje "x" y con el campo donde dice "30" lo moves en el eje "y"

  pdf.addPage('a5', 'p'); <--- Con esto añadis una pagina nueva totalmente en blanco, cuanda añadas una pagina todo lo que escribas abajo de ese addpage va a ser parte de esa ultima pagina añadida. "a5" es el formato de pagina, podes decidir usar otra en la documentacion encontras mas al respecto. Y "p" es la orientacion de la pagina "p = portrait"

Imagenes

  Añadir imagenes es lo que no pude solucionar de otra forma. Si decidis investigar y encontras una forma mejor comentalo.

  Las imagenes tienen que ir en base64 que es como el codigo base de la foto por eso es solo texto yo hice la conversion con esta pag de internet: (https://www.base64-image.de/).
  Pones la imagen, haces la conversion y despues le das a </>show code, vas a usar la que es para <img> elements, copias eso desde donde dice copy to clipboard y lo usas de la siguiente forma:

  var imgData = "elCodigoEnBase64" <--- Te conviene hacerte una variable donde guardes todo el texto que te dio la pagina de esa manera.

  Ya que tengas eso para añadir una imagen al pdf usas la siguiente funcion:

  pdf.addImage(img1Data,0,0,150,210); <--- En esta funcion usas la variable de tu imagen como primer parametro, el primer parametro "0" es como el texto, seria la "x" el otro "0" es la "y", el tercer parametro "150" seria el ancho de la foto y por ultimo el cuarto parametro "210" es el alto de la foto.

*/

/*
Espero que te sirva cualquier cosa hablame al wpp

https://artskydj.github.io/jsPDF/docs/jsPDF.html

Esa es la documentacion oficial, seguro te puede ayudar mas, me parecio ver por internet que podes hacer tus propias funciones para que el texto y las fotos se acomoden automaticamente dentro del pdf para que esten centradas, es tema de investigar.
*/

async function generatePDF(name, lastname, email) {
  var pdf = new window.jspdf.jsPDF({
      orientation: 'p',
      unit: 'mm',
      format: 'a5',
      putOnlyUsedFonts:true
      });

  pdf.text(`Hola ${name} ${lastname}`, 50, 20);
  pdf.text("gracias por dejar tus datos!!!", 40, 30);
  var img0Logo = "data:image/png;base64,"
  pdf.addImage(img0Logo,35,50);
  pdf.text("A continuacion te dejamos los productos en los que", 9, 150);
  pdf.text("tenes un 25% de descuento!!!", 38, 160);
  pdf.text("Nuevas ofertas te estaran llegando al siguiente email:", 7, 190);
  pdf.text(`${email}`, 7, 200);


  pdf.addPage('a5', 'p');
  var img1Data = "data:image/jpeg;base64,";
  pdf.addImage(img1Data,0,0,150,210);

  pdf.addPage('a5', 'p');
  var imgFinalData = "data:image/jpeg;base64,"
  pdf.addImage(imgFinalData,0,0,150,210);

  pdf.save(`Tus_Ofertas_Exclusivas.pdf`);
}

